    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge outlines Refuge accomplishments from February through April of 1942.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, fish, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    wildfires. Resource management is outlined; topics include grazing and fur harvesting.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and hunting. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
